import React from "react";
import ReactDom from "react-dom";


function countDown(start){
    let k = document.querySelector('#root')
    let m = setInterval(timer, 1000);

    function timer(){
        k.textContent = `${start < 10 ? '0' : ''}${start}`;
        start--;

        if(start < 0){
            clearInterval(m)
        }
    }
   
}

countDown()


ReactDom.render(
    <p></p>,
    document.querySelector('#root')
)
